import './App.css';
import React, { useState } from 'react';
import ReactDOM from 'react-dom/client';
import { Routes, Route,  Navigate, useLocation } from "react-router-dom";
import Header from './components/header/header'
import Menu from './components/menu/menu'
import Baner from './components/baner/baner'
import ScrollButton from './components/ScrollButton/ScrollButton'
import Footer from './components/footer/footer'
import Str1 from './components/str1/str1'
import Str2 from './components/str2/str2'
import WindowCall from './components/WindowCall/WindowCall'
import { CSSTransition } from 'react-transition-group';
// import Home from './pages/Vakansiya/Home'
// import Reports from './pages/Reports'
// import Products from './pages/Products'


function App2() {

  const [setShow, show] = useState(false);

    return (

      <>
       <div>
            <button onClick={() => setShow(!show)}>
                {show ? 'Скрыть' : 'Показать'} всплывающее сообщение
            </button>

            <CSSTransition
                in={show}
                timeout={300}
                classNames="fade"
                unmountOnExit
            >
                <div className="alert">
                    
НАША РАБОТА - КОМПЛЕКСНОЕ РЕШЕНИЕ ВАШИХ ЗАДАЧ!

Сэкономим ваши затраты и оптимизируем для вас приобретение услуги или непосредственно судна любого назначения, зафрахтуем необходимый тоннаж, разработаем логистическую схему, наиболее выгодную для перевозки.

                </div>
            </CSSTransition>
        </div>

        <div className='kl'>
   
<Header/>
<Menu/>
<Baner/>
<ScrollButton/>
<WindowCall/>
<Str1/>
<Str2/>
<Footer/>

</div>
</>
  );
}

export default App2;
